import React from "react";
import "./css/App.scss";

// Core Components
import {
    AppBar,
    Toolbar,
    Typography,
    Button,
    IconButton,
} from "@material-ui/core";

// Icon Components
import MenuIcon from "@material-ui/icons/Menu";

function App() {
    return (
        <>
            <div className="App">
                {/* Navigation Bar */}
                <AppBar color="default">
                    <Toolbar>
                        <IconButton
                            edge="start"
                            className="menuButton"
                            color="inherit"
                            aria-label="menu"
                        >
                            <MenuIcon />
                        </IconButton>
                        <Typography
                            variant="h5"
                            className="title"
                            style={"flexgrow: 1"}
                        >
                            David Ryan
                        </Typography>
                        <Button color="inherit">Test</Button>
                    </Toolbar>
                </AppBar>
            </div>
        </>
    );
}

export default App;
